import React from 'react';
import { useHistory } from 'react-router-dom';

const botaoVoltar = () => {
  const history = useHistory();

  const handleGoBack = () => {
    history.goBack();
  };

  return (
    <button onClick={handleGoBack}>
      Voltar
    </button>
  );
};

export default botaoVoltar;
